import React from 'react'
import MaterialTable from 'material-table'

const Table = () => {
  const data = [
    {main: 'Main Ranking 1',add: 'Additional Ranking 1', weight: 0.5}
  ]
  const columns = [
    {title: 'Main Rankings', field: 'main'},
    {title: 'Additional Rankings', field: 'add'},
    {title: 'Weights', field: 'weight'}
  ]

  return (
    <div>
      <MaterialTable 
      data = {data}
      columns = {columns}
      />
    </div>
  )
}

export default Table
